export function createStringArray(arr, prop) {
    var result = [];
    for (var i = 0; i < arr.length; i += 1) {
       result.push(arr[i][prop]);
    }
    return result;
 }

 export function filteredList({ list, activeObject, fieldsToCheck }) {
   return list.some((item) => {
     return fieldsToCheck.every((field) => {
      if (item.hasOwnProperty(field) && activeObject.hasOwnProperty(field)) {
         return item[field] === activeObject[field];
       } else {
         // If either object doesn't have the current field, treat them as not equal
         return false;
       }
      }
     );
   });
 }
